description:
The Intelligence Advanced Research Projects Activity (IARPA) invests in high-risk/high-
payoff research programs that have the potential to provide the USA with an overwhelming intelligence advantage

The current COVID-19 pandemic focuses attention on the need for technologies to assist with:

 Detection and sensing;
 Supply chain management and integrity;
 Geo-spatio-temporal monitoring and mapping, with privacy protection;
 Information reliability and collaboration tools; and
 Modeling, simulation, and predictive analytics.

We have an application development opportunity at RBC.  This is urgent with a start date of Sept 13, 2021.  Please see below for the description;
RBC purchased WayPay (B2B app). This we built on AWS however not in their RBC Enterprise account which meets the security policies etc..   This application needs to be moved to the appropriate account.   Further, there will be a requirement to containerize the application. This will require some coding in GoLang to create kubernetes operators. 
Full time.  440 hrs.  Eastern Timezone. Sr. Consultant. Strong communication.
